use base64::prelude::*;
use image::{DynamicImage, ImageFormat};
extern crate lazy_static;

pub struct Splatter {
    pub frames: [DynamicImage; 4],
    pub size: f32,
}

impl Splatter {
    pub fn from(strings: [&'static str; 4]) -> Splatter {
        Splatter {
            frames: [
                image_from_str(&strings[0]),
                image_from_str(&strings[1]),
                image_from_str(&strings[2]),
                image_from_str(&strings[3]),
            ],
            size: 240.0,
        }
    }
    pub fn at(&self, x: f32, y: f32) -> (i64, i64) {
        let half = self.size / 2.0;
        ((x - half).floor() as i64, (y - half).floor() as i64)
    }
}

fn image_from_str(string: &str) -> DynamicImage {
    let data = BASE64_STANDARD.decode(string).expect("Bad splatter image");
    image::load_from_memory_with_format(&data, ImageFormat::Png).unwrap()
}

pub fn for_index(
    index: usize,
    frame: usize,
    x: f32,
    y: f32,
) -> (&'static DynamicImage, (i64, i64), i64) {
    (
        match index {
            _ => {
                if let Some(img) = SPLATTER_0.frames.get(frame) {
                    &img
                } else {
                    &SPLATTER_0.frames.last().unwrap()
                }
            }
        },
        SPLATTER_0.at(x, y),
        SPLATTER_0.size as i64,
    )
}

lazy_static! {
    pub static ref SPLATTER_0: Splatter = Splatter::from(SPLATTER_0_DATA);
}

const SPLATTER_0_DATA: [&'static str; 4] = [
  "",
  "",
  "",
  "",
];
